script: |
  super -f text -I q9097.spq | sort > q9097.out

inputs:
  - name: q9097.spq
    data: |
      SELECT - + ( + 14 ) col1 FROM tab2 (FORMAT parquet) WHERE NOT ( NOT - col2 BETWEEN + 77 / + 17 AND + col0 - - + CAST ( + + ( + col1 ) AS INTEGER ) );
  - name: tab2

outputs:
  - name: q9097.out
    data: |
